urs\\\".<\\/li>\\n<li>Fix: Allow &lt;= in field calculations.<\\/li>\\n<li>Fix: Don\'t allow a negative quantity in pricing fields.<\\/li>\\n<li>Fix: When a number quantity outside the allowed range is used, force the max and min settings.<\\/li>\\n<\\/ul>\\n<h4>v4.04 - February 4, 2020<\\/h4>\\n<ul>\\n<li>New: Pricing fields have been added with a way to use products and quantities, set the currency, and automatically total up the products.<\\/li>\\n<li>New: When a WordPress parameter is added as the View detail slug or in the filters, show a warning to avoid unintended side effects.<\\/li>\\n<\\/ul>\\n<h4>v4.03.07 - January 9, 2020<\\/h4>\\n<ul>\\n<li>Project delight: Add tooltip icons in admin area for consistency instead of using the option label in some cases.<\\/li>\\n<li>Project Delight: Adjust the process before a section is deleted to reinforce the warning about deleting all child fields.<\\/li>\\n<\\/ul>\\n<h4>v4.03.06 - December 18, 2019<\\/h4>\\n<ul>\\n<li>New: Add autocomplete to user ID fields and page dropdowns on the back-end for faster form loads on sites with many users or pages.<\\/li>\\n<\\/ul>\\n<h4>v4.03.05 - December 5, 2019<\\/h4>\\n<ul>\\n<li>New: Add option to include a unit label below a slider<\\/li>\\n<li>Don\'t trigger the off balance calc check when clicking a field to insert<\\/li>\\n<li>Fix: If a field inside a repeater or section is included using the form shortcode, automatically include the parent section as well<\\/li>\\n<li>Fix: Prevent a PHP warning on post creating if no taxonomies are selected<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-pro\\/formidable-pro.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-772x250.png\"},\"beta\":{\"version\":\"4.04.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-pro-4.04.01.zip\"],\"p